import React from 'react'
import {Grid, Paper, Avatar, Typography, TextField, Button} from '@mui/material'
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import { display } from '@mui/system';



const Demo=()=>{
    const paperStyle={padding: "30px 20px", width:350, margin:"20px auto"}
    return(
        <Grid align="center">
        <Paper elevation={20} style={paperStyle}>
           <Grid>
               <Avatar>

               </Avatar>
               <h2>Signup</h2>
               <Typography variant="caption">PLease Fill this form</Typography>
           </Grid>
            <div>
                <TextField fullWidth label="Name" placeholder="Enter your name" />
                <TextField fullWidth label="Email"/>
                <FormControl component="fieldset">
  <FormLabel component="legend">Gender</FormLabel>
  <RadioGroup aria-label="gender" defaultValue="female" name="radio-buttons-group" style={{display:'initial'}}>
    <FormControlLabel value="female" control={<Radio />} label="Female" />
    <FormControlLabel value="male" control={<Radio />} label="Male" />
    <FormControlLabel value="other" control={<Radio />} label="Other" />
  </RadioGroup>
</FormControl>
                <TextField fullWidth label="Address"/>
                <Button type= "Submit" variant="contained" color="primary">Signup</Button>



            </div>

        </Paper>
        </Grid>
    )
}

export default Demo;
